package longsubstr_test

import (
	"testing"

	"github.com/fernandoocampo/justforfun/longsubstr"
)

func aTestLengthOfLongestSubstring(t *testing.T) {
	cases := map[string]struct {
		input string
		want  int
	}{
		"abcabcbb": {
			input: "abcabcbb",
			want:  3,
		},
		"bbbbb": {
			input: "bbbbb",
			want:  1,
		},
		"pwwkew": {
			input: "pwwkew",
			want:  3,
		},
		"big_one": {
			input: bigone,
			want:  95,
		},
		"aab": {
			input: "aab",
			want:  2,
		},
	}

	for name, testdata := range cases {
		t.Run(name, func(subt *testing.T) {
			got := longsubstr.LengthOfLongestSubstring(testdata.input)
			if got != testdata.want {
				subt.Errorf("want: %d, but got: %d", testdata.want, got)
			}
		})
	}
}

func aTestLengthOfLongestSubstringRec(t *testing.T) {
	cases := map[string]struct {
		input string
		want  int
	}{
		"abcabcbb": {
			input: "abcabcbb",
			want:  3,
		},
		"bbbbb": {
			input: "bbbbb",
			want:  1,
		},
		"pwwkew": {
			input: "pwwkew",
			want:  3,
		},
		"big_one": {
			input: bigone,
			want:  95,
		},
		"abcdario": {
			input: "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789",
			want:  62,
		},
		"weird": {
			input: "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!\"#$%&'()*+,-./:;<=>?@[\\]^_`{|}~ ",
			want:  95,
		},
		"aab": {
			input: "aab",
			want:  2,
		},
	}

	for name, testdata := range cases {
		t.Run(name, func(subt *testing.T) {
			got := longsubstr.LengthOfLongestSubstringRec(testdata.input)
			if got != testdata.want {
				subt.Errorf("want: %d, but got: %d", testdata.want, got)
			}
		})
	}
}

func BenchmarkLengthOfLongestSubstring(b *testing.B) {
	abcd := "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789"
	for i := 0; i < b.N; i++ {
		longsubstr.LengthOfLongestSubstring(abcd)
	}
}

func BenchmarkLengthOfLongestSubstringRec(b *testing.B) {
	abcd := "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789"
	for i := 0; i < b.N; i++ {
		longsubstr.LengthOfLongestSubstringRec(abcd)
	}
}

